INSERT INTO `ps_product_lang` VALUES
('100','1','1','IDEAL LUX to włoski producent lamp najwyższej jakości. Polecamy lampy IDEAL LUX wszystkim ceniącym sobie najwyższą jakość wykonania i najlepsze materiały. Tradycyjny włoski design w połączeniu z najnowszymi technologiami to główne cechy lamp IDEAL LUX. W ofercie lamp IDEAL LUX możemy znaleźć piękne lampy kryształowe, żyrandole klasyczne i abażurowe, lampy stołowe jak również serie oświetlenia ogrodowego: kinkiety, lampy wiszące, stojące oraz latarnie.',NULL,'lampa-stolowa-gru-tl105-bianco-147642-ideal-lux',NULL,NULL,NULL,'Lampa stołowa GRU TL105 BIANCO 147642 -Ideal Lux',NULL,NULL,NULL,NULL),
('101','1','1','Lampa biurkowa Bobby w całości wykonana została z aluminium.  Lampa w kolorze białym z satynowym wykończeniem. Obudowa klosza w górnej części wykończona jest szczotkowanym mosiądzem. Włącznik umieszczony na przewodzie. Ledowe żródło światła połączone z okragłym kloszem oraz mleczną osłoną, oferuje ciepłe i przyjemne światło. Lampa z regulacja kąta światła.King Home to ciągle nowe rozwiązania dla Twojego mieszkania. Przedstawiamy tu zbiór nowoczesnych pomysłów na urządzenie każdego wnętrza. W kolekcji King Home znajdują się między innymi modernistyczne lampy o ciekawych formach i kształtach. Meble designerskie, fotele, hokery, sofy i krzesła barowe które upiększą i nadadzą ciekawej formy wszystkim designersko urządzanym wnętrzom.King Home - to podróż po świecie nowoczesnego designu, magicznych form oświetleniowych oraz pięknych mebli designerskich dla domu, mieszkania i biura. Wspaniałe projekty oświetleniowe inspirowane najnowszymi trendami. Wśród lamp King Home znajdziesz nowoczesne lampy szklane, kryształowe oraz metalowe. W ofercie znajdują się modernistyczne lampy nowoczesne oraz minimalistyczne lampy w stylu loft industrial.',NULL,'lampa-biurkowa-bobbyled-xct8458-king-home',NULL,NULL,NULL,'Lampa biurkowa BOBBYLED XCT8458 - King Home',NULL,NULL,NULL,NULL),
