('409','1','1','Przedstawiamy stylową nowoczesną lampę podłogowąArgon Asterio kodzie3357. Lampa doskonale wpasuje się w nowoczesne i stylowe wnętrze. Doskonała lampa w stylu trójnóg na drewnianej podstawie z czarnym abażurem.  Lampa posiada duży elegancki abażur o średnicy 60 cm. Wpisuje się doskonale w trendy retro oraz nowoczesny loft.  Lampa świetnie wpasuje się w pomieszczenie takie jak: Kuchnia, jadalnia, salon oraz sypialnia. Lampa posiada jedno gniazdo na źródło E27 dlatego też możemy zastosować w niej żarówkę E27 LED lubE27 smartdzięki której możliwa będzie kontrola barwy i natężenia barwy światła za pomocą aplikacji w telefonie.Lampy Argon to nasza rodzima Polska produkcja. Klosze oraz elementy konstrukcyjne są produkowane w Polsce. Dlatego też lampy Argon to najwyższa jakość wykonania. Firma kładzie również nacisk na nowoczesne wzornictwo i ciekawe formy. LampyArgonzyskały już popularność wśród projektantów i architektów. Polecamy lampy Argon do powierzchni mieszkalnych ale także komercyjnych. Lampy Argon to nieskończone możliwości modyfikacji oferowane przez samego producenta. Każdą lampę można na zlecenie dowolnie modyfikować, np zwiększając liczbę źródeł światła lub zmieniając długość lamp i żyrandoli. Lampy Argon są wykonywane na indywidualne zlecenie, dlatego też czas realizacji zamówień oscyluję w przedziale 7-21 dni. W ofercie kinkiety, lampy wiszące, plafony, lampy podłogowe, lampy stołowe Polskiej produkcji. Polecamy markę Argon wszystkim zwolennikom pięknego światła w rozsądnej cenie.',NULL,'lampa-podlogowa-aster-3357-na-trojnogu-do-salonu-argon',NULL,NULL,NULL,'Lampa podłogowa ASTER 3357 na trójnogu do salonu – Argon',NULL,NULL,NULL,NULL),
