('447','1','1','Lampa podłogowa designerska CASERTA DC0124 - producenta DECORATIVI, który oferuje nam intrygujące i eleganckie lampy, które z pewnością wzbudzą zachwyt u każdego. Lampy zostały stworzone dla ludzi wymagających, chcących wnieść do swojego domu oryginalnego i wyrafinowanego stylu. CASERTA w swojej kolekcji posiada lampę podłogową, lampę stołową oraz lampy wiszące. Wszystkie z nich wykonane zostały z wysokiej jakości stali malowanej w trzech kolorach: złota patyna, biały i czarny. Lampy posiada trzonek E27 przystosowany do stosowania żarówki LED o maksymalnej mocy 10W lub trzonek E14 również przeznaczony do żarówek LED o maksymalnej 6W. Lampy posiada ciekawe wykończenie, dzięki czemu odwiedzający nas goście  pewnością spojrzą na lampy z zachwytem. CASERTA, to idealna propozycja do salonu, sypialni, korytarza, kuchni, czy biura.',NULL,'lampa-podlogowa-caserta-zlota-patyna-dc0124-decorativi',NULL,NULL,NULL,'Lampa podłogowa CASERTA złota patyna DC0124 - Decorativi',NULL,NULL,NULL,NULL),
('448','1','1','Lampa podłogowa designerska CELANO DC0131 - producenta DECORATIVI, który oferuje nam intrygujące i eleganckie lampy, które z pewnością wzbudzą zachwyt u każdego. Lampy zostały stworzone dla ludzi wymagających, chcących wnieść do swojego domu oryginalnego i wyrafinowanego stylu. CELANO w swojej ofercie posiada lampę stołową, podłogową i lampę wiszącą. Lampy wykonane zostały z wysokiej jakości stali malowanej na kolor brązowej patyny. Trzonek jaki został w nich zamontowany to E27, który został przystosowany do żarówki LED lub dekoracyjnej o maksymalnej mocy 10W. CELANO charakteryzują się designerskim stylem, precyzyjnym wykończeniem i niecodziennym wykonaniem. Lampy stworzone z myślą o ludziach tworzących swój własny, oryginalny styl. Koleckja idealnie odnajdzie się w salonie, sypialni, jadalni, kuchni, czy w przestrzeniach biurowych.',NULL,'lampa-podlogowa-celano-brazowa-patyna-dc0131-decorativi',NULL,NULL,NULL,'Lampa podłogowa CELANO brązowa patyna DC0131 - Decorativi',NULL,NULL,NULL,NULL),
