('452','1','1','Lampa Horse 1 UP w kształcie konia. Jeżeli lubisz trochę ekstrawagancji, ta lampa jest dla ciebie. Będzie głównym elementem wystroju każdego pomieszczenia. W całości wykonana została z tworzywa sztucznego w kolorze czarnym matowym. Abażur wykonany z materiału w dwóch kolorach. Zewnętrzna strona jest czarna i tworzy z lampą całość kolorystyczną. Wewnętrzna jesy w kolorze złotym, dzięki czemu lampa świeci przyjemnym ciepłym światłem. Ruchomy klosz umożliwia regulacje kąta padania światła.King Home to ciągle nowe rozwiązania dla Twojego mieszkania. Przedstawiamy tu zbiór nowoczesnych pomysłów na urządzenie każdego wnętrza. W kolekcji King Home znajdują się między innymi modernistyczne lampy o ciekawych formach i kształtach. Meble designerskie, fotele, hokery, sofy i krzesła barowe które upiększą i nadadzą ciekawej formy wszystkim designersko urządzanym wnętrzom.King Home - to podróż po świecie nowoczesnego designu, magicznych form oświetleniowych oraz pięknych mebli designerskich dla domu, mieszkania i biura. Wspaniałe projekty oświetleniowe inspirowane najnowszymi trendami. Wśród lamp King Home znajdziesz nowoczesne lampy szklane, kryształowe oraz metalowe. W ofercie znajdują się modernistyczne lampy nowoczesne oraz minimalistyczne lampy w stylu loft industrial.',NULL,'lampa-podlogowa-kon-horse-1-up-xcf2236g-king-home',NULL,NULL,NULL,'Lampa podłogowa KOŃ HORSE 1 UP - XCF2236.G - King Home',NULL,NULL,NULL,NULL),
