('671','1','1','Lampa podłogowa nowoczesna ALATRI DC0108 - producenta DECORATIVI, który oferuje nam intrygujące i eleganckie lampy, które z pewnością wzbudzą zachwyt u każdego. Lampy zostały stworzone dla ludzi wymagających, chcących wnieść do swojego domu oryginalnego i wyrafinowanego stylu. Rodzina ALATRI w swojej ofercie posiada lampy stołowe, lampy podłogowe i kinkiety. Lampy wykonane zostały z połączenia stali z wysokiej jakości tkaniny dostępnej w dwóch kolorach czarnym lub écru. Lampy podłogowe i stołowe wykończone zostały w czterech kolorach: mosiężnym, szampańskim, czarnym oraz w kolorze matowego niklu, a kinkiety w dwóch kolorach: mosiężnym i matowym niklu. Lampy podłogowe posiadają trzonek E27 umożliwiający stosowanie żarówki LED o maksymalnej mocy 10W, a lampy stołowe i kinkiety E14 o maksymalnej mocy 7W. ALATRI idealnie sprawdzi się jako oświetlenia każdej powierzchni w naszym domu jak i w przestrzeniach biurowych.',NULL,'lampa-podlogowa-alatri-matowy-nikiel-dc0108-decorativi',NULL,NULL,NULL,'Lampa podłogowa ALATRI matowy nikiel DC0108 - Decorativi',NULL,NULL,NULL,NULL),
