('673','1','1','Lampa podłogowa Ariana AZ3071charakteryzuje się prostą formą i dokładnością wykonania. Renomowana markaAZzardooferuje przytulne i nowoczesne oświetlenie z najwyższej jakości materiałów. Materiałowy klosz w białym kolorze doda wnętrzu niezwykłej elegancji i klasy. Tradycyjna propozycja gwarantuje przyjemną i wyjątkową atmosferę w pomieszczeniu. Oryginalna forma z precyzyjnym wykończeniem nadaje niesamowitego efektu wizualnego. Lampa Ariana doskonale sprawdzi się w przestrzeni domowej, biurowej czy komercyjnej. Perfekcyjnie rozświetli sypialnię, pokój dzienny, biuro czy kuchnię.',NULL,'lampa-podlogowa-ariana-biala-az3071-azzardo',NULL,NULL,NULL,'Lampa podłogowa Ariana  biała AZ3071 - Azzardo',NULL,NULL,NULL,NULL),
('674','1','1','Lampa podłogowa BARD AZ1125to połączenie modnego designu z dopracowanymi detalami i precyzyjnym wykończeniem. Renomowana markaAZzardooferuje przytulne i nowoczesne oświetlenie wykonane z najwyższej jakości materiałów. Oryginalny kształt w ciemnej kolorystyce dodaje interesującego efektu wizualnego. LampaBardzłatwością dopasuje się do modernistycznych i designerskich aranżacji. Wyjątkowa dekoracja zachwyci ciepłym światłem nadając przyjemnej atmosfery w pomieszczeniu. Doskonale sprawdzi się jako oświetlenie dodatkowe pokoju dziennego, biura czy sypialni.',NULL,'lampa-podlogowa-bard-czarna-az1125-azzardo',NULL,NULL,NULL,'Lampa podłogowa BARD czarna AZ1125 - Azzardo',NULL,NULL,NULL,NULL),
('675','1','1','Lampa podłogowa BOSSE AZ1028to połączenie niestandardowego designu z niezwykłą dbałością o szczegóły. Renomowana markaAZzardooferuje przytulne i nowoczesne oświetlenie wykonane z najwyższej jakości materiałów. Tradycyjny kształt i elegancka kolorystyka z łatwością dopasuje się do pozostałych elementów aranżacji. Klasyczna propozycja gwarantuje przyjemną i wyjątkową atmosferę w pomieszczeniu. Dodatkową zaletą jest możliwość regulacji wysokości ułatwiając dopasowanie lampy do wnętrza i indywidualnych potrzeb. LampaBossedoskonale sprawdzi się w przestrzeni domowej, biurowej czy komercyjnej. Perfekcyjnie rozświetli sypialnię, pokój dzienny lub biuro.',NULL,'lampa-podlogowa-bosse-czarna-az1028-azzardo',NULL,NULL,NULL,'Lampa podłogowa BOSSE czarna AZ1028 - Azzardo',NULL,NULL,NULL,NULL),
