('742','1','1','Lampa wisząca ROCK charakteryzuje się innowacyjnym pomysłem z nowoczesną formą i precyzyjnym wykonaniem. Szklany klosz o niestandardowym kształcie pokryty dekoracyjną strukturą nadaje niezwykłego efektu wizualnego. Złoty odcień dodaje wspaniałego charakteru. Nietypowe i interesujące wzornictwo doskonale spełni funkcję wyjątkowej ozdoby. Nowoczesna konstrukcja z metalu i szkła emituje ciepły, jasny blask tworząc niesamowicie przyjemną atmosferę pomieszczenia.',NULL,'lampa-wiszaca-rock-p0488-01b-u8ac-zuma-line',NULL,NULL,NULL,'Lampa wisząca ROCK P0488-01B-U8AC - Zuma Line',NULL,NULL,NULL,NULL),
