('774','1','1','Lampa o okrągłym kloszu w miedziano złotym kolorze. Bolla King Home została wykonana ze szkła metalizowanego, co nadaje jej wyrazisty lustrzany blask. Lampa polecana do nowoczesnych wnętrz glamour, minimalistycznych oraz glamour. Lampy Bolla wyglądają ciekawie powieszone obok siebie, np nad wyspą kuchenną. Lampy Bolla są dostępne w kilku rozmiarach, dzięki temu można ciekawie zaaranżować wnętrze i uzyskać interesujące efekty. Lampy Bolla są polecane również do pubów, restauracji oraz hoteli.King Home to ciągle nowe rozwiązania dla Twojego mieszkania. Przedstawiamy tu zbiór nowoczesnych pomysłów na urządzenie każdego wnętrza. W kolekcji King Home znajdują się między innymi modernistyczne lampy o ciekawych formach i kształtach. Meble designerskie, fotele, hokery, sofy i krzesła barowe które upiększą i nadadzą ciekawej formy wszystkim designersko urządzanym wnętrzom.King Home - to podróż po świecie nowoczesnego designu, magicznych form oświetleniowych oraz pięknych mebli designerskich dla domu, mieszkania i biura. Wspaniałe projekty oświetleniowe inspirowane najnowszymi trendami. Wśród lamp King Home znajdziesz nowoczesne lampy szklane, kryształowe oraz metalowe. W ofercie znajdują się modernistyczne lampy nowoczesne oraz minimalistyczne lampy w stylu loft industrial.',NULL,'lampa-wiszaca-bolla-20-jx8041-20-king-home',NULL,NULL,NULL,'Lampa wisząca  BOLLA 20 - JX8041-20 - King Home',NULL,NULL,NULL,NULL),
