('895','1','1','Lampa wisząca stylowa CIRCLE 100 ST-8848-100 - Step Into Design, jest to propozycja dla ludzi ceniących sobie nowoczesny i prosty styl. Seria CIRCLE w swojej ofercie posiada zwisy w kształcie okręgu o różnych rozmiarach. Wykonane zostały z wysokiej jakości stali malowanej w trzech wariantach kolorystycznych: szczotkowanego niklu, szczotkowanego mosiądzu oraz czarnym. W lampach zastosowano moduł LED, który doskonale oświetli pomieszczenie światłem o białej, ciepłej barwie 3000K. W kolekcji znajdziemy okręgi o średnicy 120cm, 100cm, 80cm, 60cm oraz 40cm, dzięki czemu każdy dopasuje CIRCLE do swojego pomieszczenia. Zwis idealnie odnajdzie się w przestrzeniach domowych jak i komercyjnych.',NULL,'lampa-wiszaca-circle-100-czarna-st-8848-100-step-into-design',NULL,NULL,NULL,'Lampa wisząca CIRCLE 100 czarna ST-8848-100 - Step Into Design',NULL,NULL,NULL,NULL),
