('952','1','1','Lampa sufitowa Hamburg 605016108 - DeMarkt, jest to propozycja dla ludzi szukających nowoczesnych i designerskich rozwiązań do swojego domu. Seria HAMBURG w swojej ofercie posiada kinkiety, lampy wiszące oraz sufitowe. Wykonane zostały z połączenia wysokiej jakości stali z szklanymi kloszami. Zastosowano w nich trzonek E14, który umożliwia nam stosowanie żarówek typu LED, dekoracyjnych, jak i klasycznych o maksymalnej mocy 40W. HAMBURG charakteryzuje się eleganckim designem co sprawia, że wnętrza naszego domu otrzymają nowego blasku. Idealnie sprawdzi się w pomieszczeniach domowych, jak i birowych.',NULL,'lampa-sufitowa-hamburg-605016108-demarkt',NULL,NULL,NULL,'Lampa sufitowa Hamburg 605016108 - DeMarkt',NULL,NULL,NULL,NULL),
