('956','1','1','Lampa wisząca EASTON 6 74128to połączenie wyszukanego stylu z precyzyjnym wykończeniem. Niebywale ceniony, brytyjski producentEndonoferuje profesjonalne wykonanie i najlepszą jakość z oryginalnym designem. Interesująca konstrukcja z dekoracyjnymi kloszami w stonowanej kolorystyce nada niesamowitego efektu wizualnego zachwycając elegancją i wdziękiem.Pięknie rozproszone światło wydobywające się przez ozdobną oprawę podkreśli niezwykle przyjemną i klimatyczną atmosferę we wnętrzu. Lampa wiszącaEastondoskonale sprawdzi się w kuchni, jadalni, pokoju dziennym czy sypialni.',NULL,'lampa-wiszaca-easton-6-74128-endon',NULL,NULL,NULL,'Lampa wisząca  EASTON 6 74128- Endon',NULL,NULL,NULL,NULL),
