('1078','1','1','Lampa sufitowa CRYSTAL to niesamowicie efektowna propozycja dla wnętrz. Lustrzana powłoka staje się przezroczysta po włączeniu. Wnętrze lampy jest wypełnione zwisającymi kryształkami, przypominające krople wody. Połączenie chromu z kryształkami gwarantuje piękną grę światła. Lampa sprawdzi się idealnie do salonu, kuchni, czy sypialni.',NULL,'plafon-crystal-c0076-05l-f4fz-zuma-line',NULL,NULL,NULL,'Plafon CRYSTAL C0076-05L-F4FZ - Zuma Line',NULL,NULL,NULL,NULL),
('1079','1','1','Lampa sufitowa CRYSTAL to stylowa i klasyczna propozycja dla nowoczesnych wnętrz. Delikatne kryształki umieszczone pod źródłem światła tworzy wyjątkową iluminację. Lampa oferuje wysoką jakość materiałów i staranne wykonanie dając magię pięknego oświetlenia. Idealnie nada się do przestrzeni zacisza domowego, czy też salonów piękności.',NULL,'plafon-crystal-c0076-06x-f4fz-zuma-line',NULL,NULL,NULL,'Plafon CRYSTAL C0076-06X-F4FZ - Zuma Line',NULL,NULL,NULL,NULL),
('1080','1','1','Lampa sufitowa VISTA to wyjątkowy element dekoracyjny nadający się na motyw przewodni wnętrza. Owalny, szklany klosz z eleganckimi prześwitami jest wypełniony serią kryształków, które dodają całości blasku i odbijają wpadające do pomieszczenia słońce. Srebrny kolor wprowadza do wnętrza wyjątkowy i przyjemny nastrój. Idealnie nada się do salonu czy kuchni.',NULL,'plafon-vista-c0076-06k-f4gr-zuma-line',NULL,NULL,NULL,'Plafon VISTA C0076-06K-F4GR - Zuma Line',NULL,NULL,NULL,NULL),
('1081','1','1','IDEAL LUX to włoski producent lamp najwyższej jakości. Polecamy lampy IDEAL LUX wszystkim ceniącym sobie najwyższą jakość wykonania i najlepsze materiały. Tradycyjny włoski design w połączeniu z najnowszymi technologiami to główne cechy lamp IDEAL LUX. W ofercie lamp IDEAL LUX możemy znaleźć piękne lampy kryształowe, żyrandole klasyczne i abażurowe, lampy stołowe jak również serie oświetlenia ogrodowego: kinkiety, lampy wiszące, stojące oraz latarnie.',NULL,'plafon-compo-pl10-bianco-125510-ideal-lux',NULL,NULL,NULL,'Plafon COMPO PL10 BIANCO 125510 -Ideal Lux',NULL,NULL,NULL,NULL),
