('1093','1','1','Lampa sufitowa designerska UDINE DC0023 - producenta DECORATIVI, który oferuje nam intrygujące i eleganckie lampy, które z pewnością wzbudzą zachwyt u każdego. Lampy zostały stworzone dla ludzi wymagających, chcących wnieść do swojego domu oryginalnego i wyrafinowanego stylu. UDINE w swojej ofercie posiada lampę sufitową oraz wiszącą. Wykonane zostały z wysokiej jakości stali malowanej w kolorze postarzanego złota połączonej z szklanymi wisiorkami imitującymi krople wody. W lampie został zamontowany trzonek E14, który pozwala nam stosowanie żarówki LED, klasycznej, jak i dekoracyjnej o maksymalnej mocy 40W. UDINE to propozycja dla ludzi lubiących piękny i oryginalny styl Lampa sprawi, iż odwiedzający nas goście z zachwytem będą oglądać nasze oświetlenie. Jest to idealna propozycja do montażu w salonie, sypialni, jadalni, czy holu.',NULL,'lampa-sufitowa-udine-postarzany-zloty-dc0023-decorativi',NULL,NULL,NULL,'Lampa sufitowa UDINE postarzany złoty DC0023 - Decorativi',NULL,NULL,NULL,NULL),
('1094','1','1','Oprawa sufitowa AERITH 3 76122to połączenie minimalizmu z nowoczesnością i atrakcyjnym wzornictwem. Brytyjski producentEndonoferuje modernistyczny design, interesującą stylistykę z najlepszą jakością. Oryginalna forma w szlachetnej kolorystyce z łatwością dopasuje się do każdej aranżacji zachwycając delikatnością i elegancją. Pięknie rozproszone światło wydobywające się przez dekoracyjną oprawę podkreśli niebywale przyjemną i klimatyczną atmosferę we wnętrzu. Oprawa sufitowaAerithdoskonale sprawdzi się w kuchni, sypialni, pokoju dziennym, jadalni czy biurze.',NULL,'oprawa-sufitowa-aerith-3-76122-endon',NULL,NULL,NULL,'Oprawa sufitowa AERITH 3 76122- Endon',NULL,NULL,NULL,NULL),
('1095','1','1','Oprawa sufitowa Agneta 3 AGN5350to połączenie unikalnego designu z klasyką, elegancją i wysoką jakością materiałów. Renomowany, brytyjski producentDar Lightingoferuje indywidualne podejście, modernistyczne wzornictwo z precyzyjnym wykończeniem. Solidna konstrukcja z dekoracyjnymi, szklanymi kloszami nada niesamowitego efektu wizualnego podkreślając subtelność i wdzięk oprawy. Istotną zaletą jest perfekcyjne rozszczepienie światła gwarantując przyjemną atmosferę i charakterystyczny klimat w pomieszczeniu. Oprawa sufitowaAgnetadoskonale sprawdzi się w przestrzeni domowej czy komercyjnej jako dodatkowe lub główne źródło światła.',NULL,'oprawa-sufitowa-agneta-3-agn5350-dar-lighting',NULL,NULL,NULL,'Oprawa sufitowa Agneta 3  AGN5350 - Dar Lighting',NULL,NULL,NULL,NULL),
('1096','1','1','Oprawa sufitowa Ardeche 3 ARD5350to połączenie innowacyjnego pomysłu z nowoczesną formą i najlepszą jakością. Renomowany, brytyjski producentDar Lightingoferuje indywidualne podejście, modernistyczne wzornictwo z precyzyjnym wykończeniem. Dekoracyjny, szklany klosz z metalową konstrukcją w kolorze chromu z łatwością dopasuje się do każdej aranżacji zachwycając wyjątkowym efektem wizualnym. Wyrafinowana propozycja emituje ciepłe światło gwarantując charakterystyczny klimat i nastrojową atmosferę w pomieszczeniu. Oprawa sufitowaArdecheperfekcyjnie rozświetli kuchnię, jadalnię, pokój dzienny czy pomieszczenia komercyjne.',NULL,'oprawa-sufitowa-ardeche-3-ard5350-dar-lighting',NULL,NULL,NULL,'Oprawa sufitowa Ardeche 3  ARD5350 - Dar Lighting',NULL,NULL,NULL,NULL),
