('1225','1','1','Lampa sufitowa nowoczesna BRESSO DC0122 - producenta DECORATIVI, który oferuje nam intrygujące i eleganckie lampy, które z pewnością wzbudzą zachwyt u każdego. Lampy zostały stworzone dla ludzi wymagających, chcących wnieść do swojego domu oryginalnego i wyrafinowanego stylu. BRESSO w swojej kolekcji posiada lampę podłogową i lampę sufitową. Lampy wykonane są ze stali malowanej proszkowo na kolor czarny urozmaicony szklanym białym kloszem. Oprawka na trzonek G9 przystosowany został do stosowania żarówki LED o maksymalnej mocy 3W. Lampa idealnie nada się jako oświetlenie w pomieszczeniach takich jak salon, sypialnia, jadalnia, jak i w przestrzeniach biurowych.',NULL,'lampa-sufitowa-bresso-czarna-dc0122-decorativi',NULL,NULL,NULL,'Lampa sufitowa BRESSO czarna DC0122 - Decorativi',NULL,NULL,NULL,NULL),
('1226','1','1','Lampa sufitowa loftowa LA SPEZIA DC0083 - producenta DECORATIVI, który oferuje nam intrygujące i eleganckie lampy, które z pewnością wzbudzą zachwyt u każdego. Lampy zostały stworzone dla ludzi wymagających, chcących wnieść do swojego domu oryginalnego i wyrafinowanego stylu. LA SPEZIA w swojej ofercie posiada lampę podłogową, stołową, sufitową oraz wiszącą. Wykonane zostały z wysokiej jakości stali malowanej proszkowo na dwa kolory: podstawa czarna, a klosze złote. Trzonek jaki w nich znajdziemy, to G9, który został przystosowany do żarówki LED o maksymalnej mocy 3W. Lampy stworzone zostały z myślą o ludziach ceniących sobie oryginalny styl. LA SPEZIA idealnie sprawdzi się jako oświetlenie jak i dekoracja w naszym salonie, sypialni, jadalni, holu, czy w przestrzeniach biurowych.',NULL,'lampa-sufitowa-la-spezia-czarno-zlota-dc0083-decorativi',NULL,NULL,NULL,'Lampa sufitowa LA SPEZIA czarno/złota DC0083 - Decorativi',NULL,NULL,NULL,NULL),
