('1228','1','1','Doskonała nowoczesna plafoniera z funkcją wentylatora. Plafoniera MISTRALML6092to nowoczesna lampa o kompaktowych wymiarach: jej średnica wynosi 40 cm, a wysokość ma 19 cm. Model ten został wyposażony w praktyczny wentylator o mocy 25 W, który będzie przydatny szczególnie podczas ciepłych, letnich dni. Lampą można sterować za pomocą pilota. Dzięki niemu możliwa jest zmiana barwy światła lampy, jej ściemnianie, a także regulacja mocy wentylatora. Przy tym modelu jest także możliwość rotacji wstecznej wentylatora. Plafoniera ma mleczny klosz, z którym kontrastuje czarna, wewnętrzna część tego oświetlenia. Model MISTRAL jest wypukły, co zwraca uwagę i jednocześnie sprawia, że plafoniera staje jednym z wiodących elementów wystroju wnętrza. Uniwersalna kolorystyka tego modelu i jego minimalistyczny design sprawiają, że lampa będzie świetnie wyglądać w połączeniu z bielą, szarością, czernią, jak i z wyrazistymi kolorami, jak chociażby czerwony. Plafoniera MISTRAL od marki MiLAGRO została objęta gwarancją producenta, która trwa 24 miesiące. Klosz transparentnyPlafon sprawdzi się przede wszystkim w upalne dni. Ale można z niego korzystać cały rok powodując ruch powietrza w swoich wnętrzach. Nowoczesna lampa designerska z funkcyjnym pilotem sprawdzi się jako doskonałe oświetlenie, wentylator oraz wspaniała dekoracja do nowoczesnych wnętrz w designerskim stylu',NULL,'plafon-mistral-wentylator-wiatrak-pilot-ml6092-milagro',NULL,NULL,NULL,'Plafon MISTRAL wentylator wiatrak + Pilot ML6092 - Milagro',NULL,NULL,NULL,NULL),
('1229','1','1','Wentylator ANTIBES 35069- Eglo,renomowanego producenta oświetlenia wewnętrznego i zewnętrznego EGLO. Podstawa w kolorze białym wykonana ze stali i łopaty w kolorze brązowym z tworzywa sztucznego. Nowoczesny wygląd i precyzyjne wykończenie sprawia, że jest to idealna opcja dla osób ceniących sobie nowoczesny, a zarazem prosty wygląd. W zestawie znajdziemy wentylator jak i pilot sterujący urządzeniem co da użytkownikowi dużą wygodę w użytkowaniu. Wiatrak posiada wiele funkcji takich jak:Pięć poziomów prędkości - co daje możliwość regulacji siły wiatru w zależności od potrzeb.Ciepło/Zimno - dzięki czemu wiatrak spełni zadania w lecie jak i w zimie.Możliwość automatycznego wyłączenia wiatraka po 1/4/8 godzinach pracy.',NULL,'wentylator-antibes-bialy-brazowy-35069-eglo',NULL,NULL,NULL,'Wentylator ANTIBES biały/brązowy 35069 - Eglo',NULL,NULL,NULL,NULL),
